    const canvasWorker = new Worker(
      new URL('../worker-canvas', import.meta.url),
      { type: 'module' },
    );
    // \u7EBF\u7A0B\u4E4B\u95F4\u901A\u8FC7 postMessage \u8FDB\u884C\u901A\u4FE1(\u6CE8\u610F\uFF1A\u7B2C\u4E8C\u4E2A\u53C2\u6570\u4E0D\u80FD\u7701\u7565)
